import { useEffect } from "react";
import { useState } from "react"
import Orderlist from "./orderlist";

const Home = () => {
    const [orders,setOrder] = useState(null)
   
    useEffect(() => {
        fetch('http://localhost:8000/orders')
        .then(res => {
            return res.json()
        })
        .then(data => {
            setOrder(data)
        })
    }, [])

    return (
        <div className="home">
           {orders && <Orderlist orders = { orders } name = "All orders" />}
        </div>
    );
}
 
export default Home;
